import React from "react";
import {
    BrowserRouter as Router,
    Link,
} from "react-router-dom";

const prevStyle = {
    position: 'fixed',
    left: '0',
}

const nextStile = {
    position: 'fixed',
    right: '0',
}

const Interface = (props) => {

    return (
        <nav className="navigation">
            <ul className="page-navi">
                <li className="page-navi__item" style={prevStyle}>
                    <Link to={`/${props.prev}`} className="page-navi__link">
                        <span className="arrow-prev">
                            <span className="prev">Prev</span>
                        </span>
                    </Link>
                </li>
                <li className="page-navi__item">
                    <Link to={`/${props.next}`} className="page-navi__link">
                        <span className="arrow-next">
                            <span className="next">Next</span>
                        </span>
                    </Link>
                </li>
            </ul>
        </nav>
    )
}

export default Interface;
